export default class Cube {
    constructor(){
        this.geometry = new THREE.BoxGeometry(1, 1, 1);
        this.material = new THREE.MeshNormalMaterial({});
        this.mesh = new THREE.Mesh(this.geometry, this.material);
        this.scene.add(this.cube);
    }
}
